	layer[4] = model.hook(maxpool_s(&max_pooling1d_config), layer[1]);
	layer[5] = model.hook(maxpool_s(&max_pooling1d_1_config), layer[2]);
	layer[6] = model.hook(maxpool_s(&max_pooling1d_2_config), layer[3]);
	layer[7] = model.mergex(concat_s(&concatenate_config), 3 ,layer[4] ,layer[5] ,layer[6]);
	layer[8] = model.hook(rnn_s(lstm_cell_s(&lstm_lstm_cell_config), &lstm_config), layer[7]);
	layer[9] = model.hook(rnn_s(gru_cell_s(&gru_gru_cell_config), &gru_config), layer[8]);
	layer[10] = model.hook(rnn_s(gru_cell_s(&gru_1_gru_cell_config), &gru_1_config), layer[8]);
	layer[11] = model.mergex(concat_s(&concatenate_1_config), 2 ,layer[9] ,layer[10]);
	layer[12] = model.hook(rnn_s(gru_cell_s(&gru_2_gru_cell_config), &gru_2_config), layer[11]);
	layer[13] = model.hook(maxpool_s(&max_pooling1d_3_config), layer[12]);
